/**
constructor
*/

tracers::tracers(fluid_3d& f3d):rank(f3d.rank),
	num(0),dt(f3d.dt),h{f3d.dx,f3d.dy,f3d.dz},
	u_mem(f3d.u_mem),grid(f3d.grid),sim(f3d.spars) {

	lim[0] = f3d.sm4;
	lim[1] = f3d.sn4;
	lim[2] = f3d.so4;
	del[0] = 1;
	del[1] = f3d.sm4;
	del[2] = f3d.smn4;
	low[0] = f3d.lx[0];
	low[1] = f3d.ly[0];
	low[2] = f3d.lz[0];
	glow[0] = f3d.gx[0];
	glow[1] = f3d.gy[0];
	glow[2] = f3d.gz[0];

	for(int i=0;i<27;i++) {
		slen[i] = 0; rlen[i] = 0;
	}

	gsl_rng_env_setup();
	rng = gsl_rng_alloc(gsl_rng_taus);
	gsl_rng_set(rng,1);

	grid->set_up_neighbors(neigh = new int[27]);

	setup_comms();

	// call init function
	if(f3d.spars->chk_num<=0){

		// low, globally
		double ax = f3d.gx[0]-0.5*h[0];
		double ay = f3d.gy[0]-0.5*h[1];
		double az = f3d.gz[0]-0.5*h[2];

		// width, globally
		double Lx = f3d.m * h[0];
		double Ly = f3d.n * h[1];
		double Lz = f3d.o * h[2];

		for(int i=0;i<f3d.spars->ntracers;i++){

			double rngx=ax + Lx*gsl_rng_uniform(rng);
			double rngy=ay + Ly*gsl_rng_uniform(rng);
			double rngz=az + Lz*gsl_rng_uniform(rng);
			add(rngx, rngy, rngz);
		}
	} else {
		char fname[256];
		sprintf(fname, "%s/tr.%05d", f3d.spars->chk_dirname, f3d.spars->chk_num);
		init_from_chkpt_files(f3d.spars->ntracers, fname);
	}
	MPI_Barrier(grid->cart);

	cbuf = new tracer[2*num];

	/*
	puts("f\n");
	for (tracer t:tr) {
		if (t.p_crd[0] > 200) {
			printf("here (imp_euler start)!\n");
			MPI_Abort(MPI_COMM_WORLD,0);
		}
	}
	*/
}

/** destructor */
tracers::~tracers() {
	delete[] reqs;
	delete[] stat;
	delete[] cbuf;
	delete[] neigh;
}

/** prepares tracer class for communication. commits MPI_TRACER
 *  datatype, allocates space for MPI requests and status objects */
void tracers::setup_comms() {

	// prep fields
	int n_fields = 6;
	int blengths[6] = {1,3,3,3,3,3};
	MPI_Aint offsets[6] = {offsetof(tracer,id),offsetof(tracer,p_crd),
		offsetof(tracer,rp0),offsetof(tracer,rpf),
		offsetof(tracer,v0),offsetof(tracer,vf)};
	MPI_Datatype types[6] = {MPI_INT,MPI_INT,MPI_DOUBLE,
		MPI_DOUBLE,MPI_DOUBLE,MPI_DOUBLE};

	// look at how many comms we need and allocate
	int ncomms = 54;
	if (grid->rank == 0) {
		ncomms = (ncomms>(grid->procs-1))?ncomms:(grid->procs-1);
	}
	reqs = new MPI_Request[ncomms];
	stat = new MPI_Status[ncomms];

	// setup struct and commit it
	MPI_Type_create_struct(n_fields,blengths,offsets,types,&MPI_TRACER);
	MPI_Type_commit(&MPI_TRACER);
}

/** Prints out the set of tracers across all processors to the
 * file specified by fname. The order in which they're printed
 * always remains the same */
void tracers::print(const char *fname,bool binary) {
	gather();
	if (grid->rank == 0) {

		// Convert the tracer positions into single-precision floats. Store
		// them in the original order.
		float *tout=new float[3*num],*tp;
		for(int i=0;i<3*num;i++) {
			tout[i] = 0.;
		}
		for(int i=0;i<num;i++) {
			tp=     tout+3*cbuf[i].id;
			*tp =   loc0(cbuf[i],0);
			tp[1] = loc0(cbuf[i],1);
			tp[2] = loc0(cbuf[i],2);
		}

		// Output the tracers in binary or text format
		FILE *fh=p_safe_fopen(fname,binary?"wb":"w");
		if(binary) {
			fwrite(&num,sizeof(int),1,fh);
			fwrite(tout,sizeof(float),3*num,fh);
		} else for(tp=tout;tp<tout+3*num;tp+=3)
			fprintf(fh,"%g %g %g\n",*tp,tp[1],tp[2]);
		fclose(fh);
		delete [] tout;
	}
}

void tracers::init_from_chkpt_files(const int ntracers, const char *fname, bool binary){
	if(grid->rank==0) printf("tracers:: initializing tracers from %s\n", fname);
	float *tout=new float[3*ntracers];

	// Output the tracers in binary or text format
	int lnum=0;
	size_t read_byte=0;
	FILE *fh=p_safe_fopen(fname,binary?"rb":"r");
	if(binary){
		read_byte = fread(&lnum, sizeof(int), 1, fh);
		read_byte = fread(tout,sizeof(float),3*lnum,fh);
		if(read_byte!=(unsigned int) (3*lnum) || lnum != ntracers){
			printf("tracer:: Reading check point file %s failed, or read size doesn't match that specified in cfg file.\n", fname);
			p_fatal_error("tracer:: File reading error.\n", 1);
		}
	} else {
			printf("tracer:: Does not support text check point file %s!\n", fname);
			p_fatal_error("tracer:: File reading error.\n", 1);
	}
	fclose(fh);

	for(int i=0;i<ntracers;i++){
		double chkx=tout[3*i], chky=tout[3*i+1], chkz=tout[3*i+2];
		tracer t;
		if(set (t, chkx, chky, chkz, i)) {
			tr.push_back(t);
		}
		num++;
	}
	delete [] tout;
}

/** collects all of the tracers in the communication buffer on the
 * master processors */
void tracers::gather() {
	fill_buffer();
	int ncomms = 0;
	int local_num = tr.size();
	int *local_nums=NULL;

	if (grid->rank != 0) {
		MPI_Isend(&local_num,1,MPI_INT,0,grid->rank,grid->cart,reqs);
		ncomms = 1;
	} else {
		local_nums = new int[grid->procs];
		*local_nums = local_num;
		for (int i = 1; i < grid->procs; i++) {
			MPI_Irecv(local_nums+i,1,MPI_INT,i,i,grid->cart,reqs+i-1);
		}
		ncomms = grid->procs - 1;
	}
	MPI_Waitall(ncomms,reqs,stat);

	if (grid->rank != 0) {
		if (local_num > 0) {
			MPI_Isend(cbuf,local_num,MPI_TRACER,0,grid->rank,grid->cart,reqs);
			ncomms = 1;
		} else {
			ncomms = 0;
		}
	} else {

		tracer *t = cbuf + local_num;
		ncomms = 0;

		for (int i = 1; i < grid->procs; i++) if (local_nums[i] > 0) {
			MPI_Irecv(t,local_nums[i],MPI_TRACER,i,i,grid->cart,reqs+i-1);
			t += local_nums[i];
			ncomms++;
		}

		delete[] local_nums;
	}
	MPI_Waitall(ncomms,reqs,stat);
}

/** communicates any tracers that have been advected beyond the
 * current processors boundaries to their new owner */
void tracers::communicate() {

	MPI_Request *r = reqs;
	int ncomms = 0;
	for (int i = 0; i < 27; i++) {
		if (i != 13 && neigh[i] != -1) {
			MPI_Isend(&slen[i],1,MPI_INT,neigh[i],26-i,grid->cart,r++);
			MPI_Irecv(&rlen[i],1,MPI_INT,neigh[i],i,grid->cart,r++);
			ncomms += 2;
		}
	}
	MPI_Waitall(ncomms,reqs,stat);

	tracer *st = cbuf;
	tracer *rt = st;
	for (int i = 0; i < 27; i++) if (i != 13) rt += slen[i];

	r = reqs;
	ncomms = 0;
	for (int i = 0; i < 27; i++) {
		if (i != 13 && neigh[i] != -1) {

			if (slen[i] > 0) {
				MPI_Isend(st,slen[i],MPI_TRACER,neigh[i],26-i,grid->cart,r++);
				ncomms++;
				st += slen[i];
			}

			if (rlen[i] > 0) {
				MPI_Irecv(rt,rlen[i],MPI_TRACER,neigh[i],i,grid->cart,r++);
				ncomms++;
				rt += rlen[i];
			}
		}
	}
	MPI_Waitall(ncomms,reqs,stat);
}

/** updates tracer to reflect movement out of current 4x4x4 neighborhood
 * of grid points. if tracer has moved out of current processor's volume,
 * the neighbor number of its new owner is returned. */
int tracers::proc_adjust(tracer &t,int st) {
//	puts("proc_adj\n");
//
//	if (rank==0) printf("(%d,%d,%d)+(%g,%g,%g) -> ",
//			t.p_crd[0],t.p_crd[1],t.p_crd[2],(st==0)?t.rpf[0]:t.rp0[0],
//			(st==0)?t.rpf[1]:t.rp0[1],(st==0)?t.rpf[2]:t.rp0[2]);

	int comm[3];
	for (int f = 0; f < 3; f++) {
		double &val = (st==0)?t.rpf[f]:t.rp0[f];

		while (val <= -0.5) {
			t.rp0[f] += 1.0;
			t.rpf[f] += 1.0;
			t.p_crd[f]--;
		}

		while (val > 0.5) {
			t.rp0[f] -= 1.0;
			t.rpf[f] -= 1.0;
			t.p_crd[f]++;
		}

		if (too_low(f,t,st)) {
			comm[f] = 0;
		} else if (too_high(f,t,st)) {
			comm[f] = 2;
			t.p_crd[f] -= (lim[f]-4);
		} else {
			comm[f] = 1;
		}
	}

//	if (rank==0) printf("(%d,%d,%d)+(%g,%g,%g)\n",
//			t.p_crd[0],t.p_crd[1],t.p_crd[2],(st==0)?t.rpf[0]:t.rp0[0],
//			(st==0)?t.rpf[1]:t.rp0[1],(st==0)?t.rpf[2]:t.rp0[2]);
	int ind = comm[0] + 3*comm[1] + 9*comm[2];

	//if(ind!=13) printf("proc_adjust ID %d, (%d %d %d) to proc %d\n", t.id, comm[0], comm[1], comm[2], ind);
	return ind;
}

/** fills the communication buffer with all of the processor's tracers */
void tracers::fill_buffer() {
//	printf("%d fill_buff all\n",rank);
	for (unsigned j = 0; j < tr.size(); j++) {
		cbuf[j] = tr[j];
		cbuf[j].p_crd[0] += grid->ai;
		cbuf[j].p_crd[1] += grid->aj;
		cbuf[j].p_crd[2] += grid->ak;
	}
}

/** fillse the communication buffer those tracers whose id numbers
 * are contained in the vector targets */
void tracers::fill_buffer(std::vector<int> &targets) {
//	printf("%d fill_buff some\n",rank);

	tracer *t = cbuf;
	for (int i = 0; i < 27; i++) {
		slen[i] = 0;
		if (i != 13) for (unsigned j = 0; j < tr.size(); j++) {
			if (targets[j] == i) {
				(*t++) = tr[j];
				slen[i]++;
//				printf("%d: packed: (%d,%d,%d)\n",rank,t[-1].p_crd[0],t[-1].p_crd[1],t[-1].p_crd[2]);
			}
		}
	}

	for (int i = (int) tr.size()-1; i >= 0; i--) {
		if (targets[i] != 13) {
			tr.erase(tr.begin()+i);
		}
	}
}

/** empties the communication buffer by reading received tracers
 * into this processors vector of tracers */
void tracers::empty_buffer(int st) {
//	puts("empty_buff\n");

	tracer *rt = cbuf;
	int n_in = 0;
	for (int i = 0; i < 27; i++) if (i != 13) {
		rt += slen[i];
		n_in += rlen[i];
	}

	for (int i = 0; i < n_in; i++) {
		tr.push_back(rt[i]);
		for (int f = 0; f < 3; f++) {
			double &val = (st==0)?tr.back().rpf[f]:tr.back().rp0[f];
			if (tr.back().p_crd[f] < 0 || (tr.back().p_crd[f] == 0 && val < 0)) {

//				printf("%d -> %d\n",tr.back().p_crd[f],tr.back().p_crd[f] + (lim[f]-4));

				tr.back().p_crd[f] += (lim[f]-4);
			}
		}
//		printf("%d: unpacked: (%d,%d,%d)\n",rank,tr.back().p_crd[0],tr.back().p_crd[1],tr.back().p_crd[2]);
	}
}

void tracers::print_vels(const tracer & t_tmp, int dim,int st=0) {

	int ti=t_tmp.p_crd[0],tj=t_tmp.p_crd[1],tk=t_tmp.p_crd[2];

	double tx = st==0?loc0(t_tmp,0):locf(t_tmp,0);
	double ty = st==0?loc0(t_tmp,1):locf(t_tmp,1);
	double tz = st==0?loc0(t_tmp,2):locf(t_tmp,2);
	
	printf("dim: %d\n",dim);
	printf("%d %d %d\n",ti,tj,tk);
	printf("%g %g %g\n",tx,ty,tz);
	printf("---------------------\n");

	for (int k = 0; k < 4; k++) {
		for (int j = 0; j < 4; j++) {
			for (int i = 0; i < 4; i++) {

			const int indi = i+ti, indj = j+tj, indk = k+tk;
			field &uf = u_mem[indi*del[0] + indj*del[1] + indk*del[2]];

			printf("%g ",uf.vel[dim]);
			}
			printf("\n");
		}
		printf("\n");
	}

	printf("\n\n\n");
}

void tracers::interp_vels(const tracer & t_tmp, const double (&r)[3], double (&v)[3]) {

//	printf("(%d,%d,%d\n",lim[0]-4,lim[1]-4,lim[2]-4);

	int ti=t_tmp.p_crd[0],tj=t_tmp.p_crd[1],tk=t_tmp.p_crd[2];

	// There were seg fault coming from this function
	// we first check that the indices are within bounds
	if(ti<0) {
		printf("\ntracers:: warning tracer %d index (%d, %d, %d) out of bound of the local processor index domain\n", t_tmp.id, ti, tj, tk);
		ti=0;
	}
	if(tj<0) {
		printf("tracers:: warning tracer %d index (%d, %d, %d) out of bound of the local processor index domain\n", t_tmp.id, ti, tj, tk);
		tj=0;
	}
	if(tk<0) {
		printf("tracers:: warning tracer %d index (%d, %d, %d) out of bound of the local processor index domain\n", t_tmp.id, ti, tj, tk);
		tk=0;
	}
	if(ti>lim[0]-4) {
		printf("\ntracers:: warning tracer %d index (%d, %d, %d) out of bound of the local processor index domain\n", t_tmp.id, ti, tj, tk);
		ti=lim[0]-4;
	}
	if(tj>lim[1]-4) {
		printf("tracers:: warning tracer %d index (%d, %d, %d) out of bound of the local processor index domain\n", t_tmp.id, ti, tj, tk);
		tj=lim[1]-4;
	}
	if(tk>lim[2]-4) {
		printf("tracers:: warning tracer %d index (%d, %d, %d) out of bound of the local processor index domain\n", t_tmp.id, ti, tj, tk);
		tk=lim[2]-4;
	}

	for (int f = 0; f < 3; f++) v[f] = 0;

	double c[64][3];

	for (int l = 0; l < 64; l++) {
		for (int f = 0; f < 3; f++) c[l][f] = 0;

		for (int k = 0; k < 4; k++)
			for (int j = 0; j < 4; j++)
				for (int i = 0; i < 4; i++) {

				const int indi = i+ti, indj = j+tj, indk = k+tk;
				field &uf = u_mem[indi*del[0] + indj*del[1] + indk*del[2]];
				for(int n=0;n<3;n++) c[l][n] += Ivmonde[i + 4*j + 16*k + 64*l] * uf.vel[n];
		}
	}

	double term;
	for (int k = 0; k < 4; k++)
		for (int j = 0; j < 4; j++)
			for (int i = 0; i < 4; i++) {

		term = pow(r[0],i)*pow(r[1],j)*pow(r[2],k);
		for (int f = 0; f < 3; f++) {
			v[f] += c[i + 4*j + 16*k][f] * term;
		}
	}
}

